import React, { useState } from 'react';
import './App.css';

function App() {

const [todos, setTodos ] = useState([
  { 
    text: "Shopping",
    isCompleted: false
  },
  { 
    text: "Visit Grandma",
    isCompleted: false
  },
  { 
    text: "Meet Steve",
    isCompleted: false
  },
])


  return (
    <div className="App">
      <header className="App-header">
        <p>    
          ToDo List
        </p>
        <p>
          { todos.text.map(todo => {
              todo.text
          }) }
        </p>

      </header>
    </div>
  );
}

export default App;
